function getProductsFromCategory(category){
    let to_return=["id|description|price"]
    myCatalog.forEach((product)=>{
        if(product.category != undefined && product.category==category){
            let productAsString=product.entity_id+"|"+product.description+"|"+product.price
            to_return.push(productAsString)
        }
    })
    return to_return
}
