async function  convertCsvToJson(csvContent){
    try {
      const jsonArray = await csvtojson().fromString(csvContent);
      return jsonArray;
    } catch (error) {
      console.error('Errore durante la conversione del CSV:', error);
      throw error;
    }
  }


async function generateText(prompt) {
    const requestOptions = {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${API_TOKEN}`
        },
        body: JSON.stringify({
            model: "gpt-3.5-turbo",
            messages: [
                { role: "user", content: prompt },
            ],
            max_tokens: 100 // Numero massimo di token da generare
        })
    };

    try {
        const response = await fetch(endpoint, requestOptions);
        if (!response.ok) {
            throw new Error('Errore nella richiesta API: ' + response.statusText);
        }
        const data = await response.json();
        return data
    } catch (error) {
        console.error('Errore durante la richiesta API:', error);
        throw error;
    }
}

async function getCategories(){
    try {
        const response = await axios.get(`${magentoUrl}/rest/V1/categories`, {
        headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json'
        }
        });

        const categories = response.data.children_data;
        let categoriesList=[]
        categories.forEach((cat)=>{
            categoriesList.push(cat.name)
            categoriesMapping[cat.name]=cat.id
        })
        return categoriesList
    } catch (error) {
        console.error('Error fetching categories:', error);
    }
};

